// SignInPage.js
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './SignInPage.css';

function SignInPage() {
  const [fullName, setFullName] = useState('');
  const [mobile, setMobile] = useState('');
  const [email, setEmail] = useState('');
  const [newPassword, setNewPassword] = useState('');
  const [showPremiumPrices, setShowPremiumPrices] = useState(false);
  const [validationErrors, setValidationErrors] = useState({
    fullName: '',
    mobile: '',
    email: '',
    newPassword: '',
  });

  const handleCombined = () => {
    if (validateInputs()) {
      console.log('SignUp Data:', { fullName, mobile, email, newPassword });
      // Perform SignUp logic here, such as sending data to the server
      // You can add further logic for API calls, etc.
      
      handleCalculateSum();
      setShowPremiumPrices(true);
    } else {
      console.log('Validation failed. Please check the input values.');
      // You can add additional logic if needed when validation fails.
    }
  };

  const handleSignUp = () => {
    if (validateInputs()) {
      console.log('SignUp Data:', { fullName, mobile, email, newPassword });
      // Perform SignUp logic here, such as sending data to the server
      // You can add further logic for API calls, etc.
    } else {
      console.log('Validation failed. Please check the input values.');
    }
  };

  const validateInputs = () => {
    // ... (validation logic remains the same)
  };

  const handleCalculateSum = () => {
    // ... (handleCalculateSum logic if needed)
  };

  return (
    <div className='signin-container'>
      <h2>Sign Up</h2>
      <form className='signin-form'>
        <div className='form-group'>
          <label>Full Name:</label>
          <input
            type='text'
            className='form-control'
            value={fullName}
            onChange={(e) => setFullName(e.target.value)}
          />
          <p className='error-message'>{validationErrors.fullName}</p>
        </div>

        <div className='form-group'>
          <label>Mobile:</label>
          <input
            type='text'
            className='form-control'
            value={mobile}
            onChange={(e) => setMobile(e.target.value)}
          />
          <p className='error-message'>{validationErrors.mobile}</p>
        </div>

        <div className='form-group'>
          <label>Email:</label>
          <input
            type='email'
            className='form-control'
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <p className='error-message'>{validationErrors.email}</p>
        </div>

        <div className='form-group'>
          <label>New Password:</label>
          <input
            type='password'
            className='form-control'
            value={newPassword}
            onChange={(e) => setNewPassword(e.target.value)}
          />
          <p className='error-message'>{validationErrors.newPassword}</p>
        </div>

        {showPremiumPrices && (
          <>
            <h2>Premium Prices As per Years</h2>
            {!Object.values(validationErrors).some((errorMessage) => errorMessage) && (
              <Link to='/nextpage' className='btn btn-success' onClick={handleCombined}>
                Sign Up
              </Link>
            )}
          </>
        )}
      </form>
    </div>
  );
}

export default SignInPage;
